                s[i][j] = '0';
            }
        }

        for(int i = 0; i < 8; i++)
        {
            cin>>s[i];
        }

        char figure;

        bool solved = true;

        for(int i=0;i<8;i++)
        {
            for(int j=0;j<8;j++)
            {
                if(s[i][j]!='1')
                {
                    continue;
                }

                if(solved)
                {
                    figure = Solution(i, j);

                    cout<<figure<<endl;

                    solved = false;
                }
            }
        }
    }
    return 0;
}

