    sum += field[y][x + 1] - '0';
    sum += (field[y + 1][x + 1] - '0') << 1;
    sum += (field[y + 1][x] - '0') << 2;
    if (x > 0) {
        sum += (field[y + 1][x - 1] - '0') << 3;
    }
    switch (sum) {
    case 7:
        return 'A';
        break;
    case 4:
        return 'B';
        break;
    case 1:
        return 'C';
        break;
    case 12:
        return 'D';
        break;
    case 3:
        return 'E';
        break;
    case 6:
        return 'F';
        break;
    case 13:
        return 'G';
        break;
    default:
        return '0';
        break;
    }
}

