bool matched(const bool map[8][8], const bool* pattern, const int h, const int w) {
    for (int i = 0; i < 8 - h + 1; i++) {
        for (int j = 0; j < 8 - w + 1; j++) {
            bool unmatched = false;
            for (int a = 0; a < h; a++) {
