typedef vector<string> v;

char pat_search(v &a) {
	static auto p = [&a](int i, int j) {
		return i >= 0 && i < 8 && j >= 0 && j < 8 && a[i][j] == '1';};
	for (int i = 0; i < 8; i++)
		for (int j = 0; j < 8; j++)
			if (a[i][j] == '1') {
				return p(i + 1, j + 1) ? p(i, j + 1) ? p(i + 1, j + 2) ? 'E' : 'A' : 'F' :
					p(i, j + 1) ? p(i, j + 2) ? 'C' : 'D' :
					p(i + 2, j) ? 'B' : 'G';
			}
	return 'X';
}

