struct Rect
{
	Rect(){
		minX = minY = 10000;
		maxX = maxY = -10000;
	}
	void add(int i, int j){
		if (minX > i) minX = i;
		if (minY > j) minY = j;
		if (maxX < i) maxX = i;
		if (maxY < j) maxY = j;
	}
	int getWidth() {
		return (maxY - minY + 1);
	}
	int getHeight() {
		return (maxX - minX + 1);
	}
	int minX;
	int minY;
	int maxX;
	int maxY;
};
