bool match( const vector<string>& a, int x, int y, int fig_i ) {
	for( int i = 0; i < 4; ++i ) {
		x += fig[fig_i][i].x;
		y += fig[fig_i][i].y;

		if( x < 0 || y < 0 || x >= fld || y >= fld || a[y][x] == '0' ) {
			return false;
		}
	}

	return true;
