	for( int i = 0; i < fld; ++i ) {
		for( int j = 0; j < fld; ++j ) {
			for( int k = 0; k < fig.size(); ++k ) {
				if( match( a, j, i, k ) ) { return k; }
			}
		}
	}

	return -1;
}

