#include<stdio.h>
#define rep2(i,n) rep3(i,0,n)
#define rep3(i,j,n) for((i)=(j) ; (i)<(n) ; (i)++)
#define pl(format,var) p(format "\n",var)
#define p(format,var) printf(format,var)
#define asizeof(array) (sizeof(array)/sizeof(array[0]))

#define XMAX 8 //入力データ横サイズ
#define YMAX 8 //入力データ縦サイズ
#define PATTERN_NUM 7 //パターン数
/*
履歴
・

[メモ1]
A-G用のデータを作る。
たとえばAならこんなデータを持たせたい
	A
	0,1
	1,0
	0,-1
1を見つけたら、添字をこの通りに探索する。
全て探索して、全部1だったら、Aってことになる。

どのパターンも3回辿ることになるから、データ構造は配列でいいか。

		//パターンを検索
		printf("##\n");
		rep2(i,YMAX){
			rep2(j,XMAX){
				p("%d",array[i][j]);
			}
			printf("\n");
		}
		printf("##\n");


→ (0,1)
↓ (1,0)
*/
int main(){
	char line[80]; //入力行
	int array[8][8]; //入力データ1つ
	int pattern[PATTERN_NUM*3][2]={ /* パターン探索データ */
		{0,1},{1,0},{0,-1}, /* A */
		{1,0},{1,0},{1,0}, /* B */
		{0,1},{0,1},{0,1}, /* C */
		{1,0},{0,-1},{1,0}, /* D */
		{0,1},{1,0},{0,1}, /* E */
		{1,0},{0,1},{1,0}, /* F */
		{0,1},{-1,0},{0,1} /* G */
	};
	int i,j,k,l; //カウンタ変数
	int ti,tj; //探索先インデックス
	char ans; //答え

	while(1){
		//一つの入力データを読み込む
		rep2(i,YMAX){
			fgets(line, sizeof(line), stdin);
			rep2(j,XMAX){
				array[i][j] = line[j] - '0';
			}
		}

		//パターンを探索
		rep2(i,YMAX){
			rep2(j,XMAX){
				if(array[i][j] == 1){
					//パターン探索データに従って探す
					rep2(k,PATTERN_NUM){
						ti = i;
						tj = j;
						//探索データ一つ一つを当てはめる
						ans = 1;
						rep2(l,3){
							ti += pattern[(k*3)+l][0];
							tj += pattern[(k*3)+l][1];
							//探索先がデータをはみ出るか, その値が0であれば
							//このパターンはマッチしないことを表す
							if(ti<0 || ti>=YMAX || tj<0 || tj>=XMAX || array[ti][tj]==0){
								ans = 0;
								break;
							}
						}
						//パターンマッチしたら, 該当する文字を出力し, 探索終了
						if(ans){
							pl("%c",'A'+k);
							goto SEARCH_END;
						}
					}
				}
			}
		}

SEARCH_END:
		//改行区切りを読み込んだら, 続行する
		fgets(line, sizeof(line), stdin);
		if(line[0] != '\n')
			break;
	}

  return 0;
}

