							field[i+1][j  ] &&
							field[i+1][j+1]	&&
							field[i+2][j+1]	
						){
							type = E;
							s_end = 1;
							break;
						}else if(
							field[i  ][j+1] &&
							field[i+1][j+1] &&
							field[i+1][j+2] 
						){
							type = F;
							s_end = 1;
							break;
						}
					}
				}
			}
