#include <stdio.h>

#define NROW 8
#define NCOL 8
#define NBIT (NROW*NCOL)
#define LENGTH (NCOL+2)
#define NPATTERN 7

int search_offset(char *bit);
int calc_indicator(char *bit, int offset);
char indicator2pattern(int indicator);

int main(){
   int nline, i, j, offset, indicator;
   char pattern;
   char line[NROW][LENGTH], bit[NBIT];
   while(!feof(stdin)){
      nline=0;
      if(fscanf(stdin,"%s",line[nline])==1){
         for(nline=1;nline<NROW;nline++) fscanf(stdin,"%s",line[nline]);
         for(i=0;i<NROW;i++){
            for(j=0;j<NCOL;j++) bit[i*NCOL+j]=line[i][j];
         }
         offset=search_offset(bit);
         indicator=calc_indicator(bit,offset);
         pattern=indicator2pattern(indicator);
         printf("%c\n",pattern);
      }
   }
   return 0;
}

int search_offset(char *bit){
   int i;
   for(i=0;i<NBIT;i++){
      if(bit[i]!='0') return i;
   }
   return -1;
}

int calc_indicator(char *bit, int offset){
   int i, indicator;
   for(i=offset+1,indicator=0;i<NBIT;i++){
      if(bit[i]!='0') indicator+=(i-offset);
   }
   return indicator;
}

/*
  A : 1+8+9   = 18
  B : 8+16+24 = 48
  C : 1+2+3   =  6
  D : 7+8+15  = 30
  E : 1+9+10  = 20
  F : 8+9+17  = 34
  G : 1+7+8   = 16
*/
char indicator2pattern(int indicator){
   int i;
   int match[NPATTERN]={ 18, 48, 6, 30, 20, 34, 16 };
   char pattern[]="ABCDEFG";
   for(i=0;i<NPATTERN;i++){
      if(indicator==match[i]) return pattern[i];
   }
   return '?';
}

