char opera (int i, int j, char array[10][10])
{
	int line = 0;
	int row  = 0;
	int obli = 0;

	if (array[i][j + 1] 	== '1'){
		line++;
		if (array[i][j + 2]	== '1'){
			return ('C');
		}
	}
	if (array[i + 1][j] 	== '1'){
		row++;
		if (array[i + 2][j] == '1'){
			return ('B');
		}
	}
	if (array[i + 1][j + 1] == '1'){
		obli++;
	}

	if (line >= 1){
		if (row >= 1){
			if (obli >= 1){
				return ('A');
			}
			return ('G');
		}
		return ('E');
	}

	if (row >= 1){
		if (obli >= 1){
			return ('F');
		}
		return ('D');
	}

}

