             0 <= j_2 && j_2 < 8 &&
             0 <= i_3 && i_3 < 8 &&
             0 <= j_3 && j_3 < 8 &&
             0 <= i_4 && i_4 < 8 &&
             0 <= j_4 && j_4 < 8    ) {

