    		case 1: { ret = 'B'; break;}
    		case 2: { ret = 'C'; break;}
    		case 3: { ret = 'D'; break;}
    		case 4: { ret = 'E'; break;}
    		case 5: { ret = 'F'; break;}
    		case 6: { ret = 'G';       }
    	}
    	return ret;
    }
