		main : for (int i = 0; i < str.length; i++) {
			for (int j = 0; j < str[i].length(); j++) {
				if (str[i].charAt(j) == '1') {
					baseX = j;
					baseY = i;
					break main;
				}
			}
		}

		// 右にある？
		if (str[baseY].charAt(baseX + 1) == '1') {

			// 下にある？
			if (str[baseY + 1].charAt(baseX) == '1')
				return str[baseY + 1].charAt(baseX + 1) == '1' ? "A" : "G";
			else
				return str[baseY + 1].charAt(baseX + 1) == '1' ? "E" : "C";

