	public static int[] getTop(char[][] plane) {
		int r = -1;// row
		int c = -1;// column

		outer: for (int i = 0; i < 8; i++) {
			for (int j = 0; j < 8; j++) {
				// System.out.print(plane[i][j]);
				if (plane[i][j] == '1') {
					r = i;
					c = j;
					break outer;
				}
			}
			// System.out.println();
		}
		return new int[] { r, c };
	}

	public static boolean isA(char[][] plane, int[] top) {
		int r = top[0];// row
		int c = top[1];// column

		try {
			if (plane[r][c] == '1')
				if (plane[r][c + 1] == '1')
					if (plane[r + 1][c] == '1')
						if (plane[r + 1][c + 1] == '1')
							return true;
		} catch (ArrayIndexOutOfBoundsException e) {
			return false;
		}
		return false;
	}

