		int r = top[0];// row
		int c = top[1];// column

		try {
			if (plane[r][c] == '1')
				if (plane[r + 1][c] == '1')
					if (plane[r + 2][c] == '1')
						if (plane[r + 3][c] == '1')
							return true;
		} catch (ArrayIndexOutOfBoundsException e) {
			return false;
		}
		return false;
	}

