							return true;
		} catch (ArrayIndexOutOfBoundsException e) {
			return false;
		}
		return false;
	}

	public static boolean isD(char[][] plane, int[] top) {
		int r = top[0];// row
		int c = top[1];// column

		try {
			if (plane[r][c] == '1')
				if (plane[r + 1][c - 1] == '1')
