                        }
                    }
                }
            }
        }
        return false;
    }

    static boolean searchC(int[][] plane){
        for(int i = 0; i < height; i++){
            for(int j = 0; j < width - 3; j++){
                if(plane[i][j] == 1){
                    if(plane[i][j + 1] == 1){
                        if(plane[i][j + 2] == 1){
                            if(plane[i][j + 3] == 1){
                                return true;
                            }
                        }
                    }
                }
            }
        }
        return false;
    }

    static boolean searchD(int[][] plane){
        for(int i = 0; i < height - 2; i++){
            for(int j = 1; j < width; j++){
                if(plane[i][j] == 1){
                    if(plane[i + 1][j - 1] == 1){
                        if(plane[i + 1][j] == 1){
                            if(plane[i + 2][j - 1] == 1){
                                return true;
                            }
                        }
                    }
                }
            }
        }
        return false;
    }

    static boolean searchE(int[][] plane){
        for(int i = 0; i < height - 1; i++){
            for(int j = 0; j < width - 2; j++){
                if(plane[i][j] == 1){
                    if(plane[i][j + 1] == 1){
                        if(plane[i + 1][j + 1] == 1){
                            if(plane[i + 1][j + 2] == 1){
                                return true;
                            }
                        }
                    }
                }
            }
        }
        return false;
    }

    static boolean searchF(int[][] plane){
        for(int i = 0; i < height - 2; i++){
            for(int j = 0; j < width - 1; j++){
                if(plane[i][j] == 1){
                    if(plane[i + 1][j] == 1){
                        if(plane[i + 1][j + 1] == 1){
                            if(plane[i + 2][j + 1] == 1){
                                return true;
                            }
                        }
                    }
                }
            }
        }
