				for(int j=0; j<8; ++j){
					//入力をboolean配列に置き換える。
					data[i][j] = Integer.parseInt("" + str.charAt(j)) == 1;
				}
			}

			for(int i=0; i<8; ++i){
				for(int j=0; j<8; ++j){
					if(data[i][j]){
						if(checkA(data, i, j)){
							System.out.println("A");
