				String line = sc.nextLine();

				for (int j = 0; j < 8; j++) {
					map[i][j] = line.charAt(j) - '0';
				}
			}
			if (sc.hasNext() == true) sc.nextLine();

			int state = 0;
			int max = 8;
			int k = 0;
			int left = 0;

			boolean end = false;
			for (int i = 0; i < max; i++) {
				for (int j = (k + left); j < 8; j++) {
					if (map[i][j] == 1) {
						switch (state) {
						case 0:
							state = 1;
							max = i + 4;
							k = j - 1;

							if (j == 0) {
								left = 1;
							}
							break;

						case 1:
							state = 2;
							break;

						case 2:
							state = 3;
							break;

						case 3:
							System.out.println("C");
							end = true;
							break;

						case 4:
							if (j == k) {
								System.out.println("D");
								end = true;
							} else {
								state = 6;
							}
							break;

