		int firstBlockX = getFirstBlockX();
		int firstBlockY = getFirstBlockY();
		for(int i = 1; i <= 3; i++){
			if((firstBlockY + i) >= MAX_BLOCKS_IN_LINE){
				return false;
			}
		}

		int numBlocks = 0;

