                    if (text.charAt(j) == '1') {
                        if (sum == 0) {
                            offsetX = j;
                            offsetY = i;
                            sum++;
                        } else {
                            sum += i * 4 - offsetY * 4 + j - offsetX + 1;
                        }
                    }
                }
            }
            char answer = 0;
            switch (sum) {
            case 14:
                answer = 'A';
                break;
