			else
				return str[baseY + 1].charAt(baseX + 1) == '1' ? "E" : "C";

		} else {

			if (str[baseY + 2].charAt(baseX) == '1')
				return "B";
			else
				return str[baseY + 1].charAt(baseX + 1) == '1' ? "F" : "D";

		}
	}

