								end = true;
							}
							break;

						case 6:
							System.out.println("F");
							end = true;
							break;
						}
					}
					if (end == true) break;
				}

				if ((state == 1) || (state == 2)) {
					state = state + 3;
				} if (state == 6) {
					System.out.println("B");
					end = true;
