    //Datasetと座標を受け取って、該当するテトリスミノがあるか調べる
    public static string scanEdge_judge(Dataset dataset,int x,int y){
        if(dataset.getValue(x+1,y) == 1 && dataset.getValue(x,y+1) == 1 && dataset.getValue(x+1,y+1) == 1) return "A";
        if(dataset.getValue(x,y+1) == 1 && dataset.getValue(x,y+2) == 1 && dataset.getValue(x,y+3) == 1) return "B";
        if(dataset.getValue(x+1,y) == 1 && dataset.getValue(x+2,y) == 1 && dataset.getValue(x+3,y) == 1) return "C";
        if(dataset.getValue(x,y+1) == 1 && dataset.getValue(x-1,y+1) == 1 && dataset.getValue(x-1,y+2) == 1) return "D";
        if(dataset.getValue(x+1,y) == 1 && dataset.getValue(x+1,y+1) == 1 && dataset.getValue(x+2,y+1) == 1) return "E";
        if(dataset.getValue(x,y+1) == 1 && dataset.getValue(x+1,y+1) == 1 && dataset.getValue(x+1,y+2) == 1) return "F";
        if(dataset.getValue(x+1,y) == 1 && dataset.getValue(x,y+1) == 1 && dataset.getValue(x-1,y+1) == 1) return "G";
        return "none";
    }
