def matchable(source, target, width)
  return false  if source.length != target.length

  (9 - width).times{|n|
    found = true
    source.length.times{|l|
      found = false   if source[l] ^ target[l] >> n != 0
    }
    return true  if found
  }
  return false
end

def cutFigure(figure)
  subFigure = Array.new
  figure.each{|n|
    subFigure << n  if n != 0
  }
  return subFigure
end

def findFigure(figure)
  source = cutFigure(figure)
  return "A"  if matchable(source, A, 2)
  return "B"  if matchable(source, B, 1)
  return "C"  if matchable(source, C, 4)
  return "D"  if matchable(source, D, 2)
  return "E"  if matchable(source, E, 3)
  return "F"  if matchable(source, F, 2)
  return "G"  if matchable(source, G, 3)
end


