class Plain:
    def __init__(self, mat):
        self.plain = mat

    def show(self):
        for i in range(8):
            print self.plain[i]

    def shift(self):
        while all_zero(self.plain[0]):
             shift_lis(self.plain)
        while all_zero(map(lambda x: x[0], self.plain)):
            map(shift_lis, self.plain)
        return self

    def match_figure(self, figs):
        for (name, fig) in figs:
            if self.match(fig):
                return  name

    def match(self, fig):
        lx = len(fig[0])
        ly = len(fig)
        result = True
        for y in range(ly):
            for x in range(lx):
                if not fig[y][x] == self.plain[y][x]:
                    result = False
        return result


