use std::io;
use std::io::prelude::*;

fn solve (plane: &[u8], first: usize) -> char {
    if plane.get(first + 18) == Some(&b'1') {
        'B'
    } else if plane.get(first + 2) == Some(&b'1') {
        'C'
    } else if plane.get(first + 17) == Some(&b'1') {
        'D'
    } else if plane.get(first + 11) == Some(&b'1') {
        'E'
    } else if plane.get(first + 19) == Some(&b'1') {
        'F'
    } else if plane.get(first + 8) == Some(&b'1') {
        'G'
    } else {
        'A'
    }
}

fn main () {
    let mut stdin = io::stdin();
    let mut buf = [0; 72];

    loop {
        let mut dump = String::new();
        stdin.read_exact(&mut buf);
        let first = buf.iter().position(|&x| x == b'1').unwrap();
        println!("{}", solve(&buf, first));
        if stdin.read_line(&mut dump).unwrap() == 0 {
            break;
        }
    }
}
